import React from "react";

let x = props.x;
let y = props.y;
let z = props.z;


const Puzzle = (props) => {
        return(
            <>
                <div className="puzzlebox">
                    <div>
                        <h1>{x} {y} {z}</h1>
                        <p></p>
                    </div>
                </div>
            </>
        );
}

export default Puzzle;
